import { Container, Typography } from "@material-ui/core";
import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { useParams } from "react-router-dom";
import { getClass } from "../Redux/app/action";

export default function TeacherDetails() {
  const token = useSelector((state) => state.auth.token);
  const { id } = useParams();
  const selectedTeacher = useSelector((state) => state.app.selectedTeacher);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getClass(token, id));
  }, []);
  return (
    <Container>
      <Typography variant="h5">{selectedTeacher.name}</Typography>
      <Typography variant="body1">{selectedTeacher.subject}</Typography>
    </Container>
  );
}
